Scriptlets are considered bad and ugly . There are two big complaints about putting Java code into a JSP: Web page designers and front-end developers should not have to know Java . Java code in a JSP is hard to change and maintain . To solve this problem, expression language (EL for short) is designed to get rid of Java code. An EL always looks like this: ${something}. In other words, the expression always enclosed in curly braces, and prefixed with a dollar ( $ ) sign. EL is the base of scriptless JSP. Let's study how to use EL by an example. First, a Book class contains the title and price: public class Book { private String title; private float price; ...
} And a User has a favorite book: public class User { private String name; private int age; private Book favourite; ...
} Then in HelloServlet.java of ch5/el, we add an attribute into request scope. Finally, we forward this request. Book book = new Book("Gone with the wind", 42.0f);
User user = new User("Mary", 18, book);
request.setAttribute("user", user);
request.setAttribute("name", "Mary");
request.getRequestDispatcher("/WEB-INF/home.jsp").forward(request, response); Without EL, in order to get data from request's attribute, we have to use scriptlet : <% String name = (String) request.getAttribute("name"); User user = (User) request.getAttribute("user");
%>
<%= name %>
<%= user.getName() %> But with EL, it can be simplified dramatically: ${name}
${user.name} Similarly, we can even get the price of this user's favorite book: ${user.favourite.price} EL makes it easy to print nested properties. Elegant, isn't it? In the next chapter, we will try to deconstruct EL.

