The dot operator works only when the thing on the right is a bean property or map key for the thing on the left. That's it. But the [] operator is a lot more powerful and flexible. ${user["name"]}
${user.name} The two lines of code are identical, but [] is better because it gives you more options: the thing on the left can also be a List or an array. That also means the thing on the right can be a number, or anything that resolves to a number, or an identifier that doesn't fit the Java naming rules. For example, you might have a Map key in the name "com.swufe.javaee". Figure 5.3 EL with [] operator. [!TIP] For beans and Maps, you can use either dot operator or bracket operator[5]. The following is an example using the [] operator with an array. In BookServlet.java, String[] books = {"Gone with the Wind", "The Great Gatsby", "1587, a Year of No Significance"};
request.setAttribute("bookArray", books);
request.getRequestDispatcher("/WEB-INF/book.jsp").forward(request, response); In book.jsp, ${bookArray[0]} It even works when the index is a String literal, and the index is coerced to an int: ${bookArray["0"]. We can also use nested expressions inside the brackets . Based on the previous example, we add a HashMap to count books: Map<String, Integer> bookCount = new HashMap<>();
bookCount.put("Gone with the Wind", 42);
bookCount.put("The Great Gatsby", 100);
bookCount.put("1587, a Year of No Significance", 130);
request.setAttribute("bookCount", bookCount); And in JSP, ${bookCount[bookArray[0]]} will output 42. Figure 5.4 Nested [] operators.

