[!TIP] TL;DR . We only use INTEGER , REAL , and TEXT for simplicity, and you can think of it as int, double, and String in Java, respectively. When defining relation schemas, we must specify the attributes' data types[2]. The most commonly used data types are listed below: char(n) : A fixed length character string with user-specified length n . varchar(n) : A variable-length character string with user-specified maximum length n . int : An integer. numeric(p, d) : A fixed-point number with user-specified precision. For example, numeric(3, 1) allows 42.1 to be stored. real , double precision : Floating-point and double precision floating point numbers. float(n) : A floating-point number with precision of at least n digits. But each value stored in an SQLite database (or manipulated by the database engine) has one of the following storage classes: INTEGER REAL TEXT BLOB NULL So, is SQL written in standard syntaxes not compatible with SQLite? The answer is yes or no . 1) No two SQL database engines work exactly alike, so incompatibility sometimes is avoidable. 2) SQLite supports the concept of type affinity on columns. For example, both char(n) and varchar(n) will convert to affinity type TEXT [3]. SQLite strives to be flexible regarding the datatype of the content that it stores. For example, if a table column has a type of "INTEGER", then SQLite tries to convert anything inserted into that column into an integer. So an attempt to insert the string '123' results in an integer 123 being inserted. But if the content cannot be losslessly converted into an integer, for example if the input is 'xyz', then the original string is inserted instead. For the sake of simplicity, in what follows, we only use three data types: INTEGER , REAL , and TEXT . By the way, SQLite does not have a storage class set aside for storing dates and/or times. In this textbook, we use TEXT to store date as ISO8601 strings (YYYY-MM-DD HH:MM:SS.SSS)[4]. We define an SQL relation by using CREATE TABLE command. The following command crates a relation book in the database: CREATE TABLE book( ISBN TEXT PRIMARY KEY, title TEXT, author_name TEXT, price REAL
); Since primary key for book consists of a single column ( ISBN ), the keywords PRIMARY KEY is added to a column definition. Alternatively, it can also be specified as a table constraint : CREATE TABLE book( ISBN TEXT, title TEXT, author_name TEXT, price REAL, PRIMARY KEY(ISBN)
); To remove a relation from an SQL database, we use DROP TABLE command: DROP TABLE book;

129.body:
Besides PRIMARY KEY , we can specify more constraints for relations. For example, NOT NULL : By default, a column can be a null value. We can add NOT NULL attached to a column definition. DEFAULT : The DEFAULT clause specifies a default value to use for the column if no value is explicitly provided by the user when doing an INSERT [5]. UNIQUE : It is similar to PRIMARY KEY [6]. Another important constraint on the contents of relations are called foreign-key constraints. Consider the attribute author_name of the book relation. It would not make sense for a tuple in book have a value for author that does not correspond to a name in the author relation. In this case, the attribute author_name in book is a foreign key, referencing author. CREATE TABLE author( name TEXT PRIMARY KEY, birth TEXT, country TEXT
); Suppose every author has a unique name. CREATE TABLE book( ISBN TEXT, title TEXT NOT NULL, author_name TEXT, price REAL DEFAULT 9.9, PRIMARY KEY(ISBN), FOREIGN KEY(author_name) REFERENCES author(name)
);

