The JDBC[1] standard APIs that Java programs can use to connect to database servers. Like Java EE, JDBC is only a set of specifications, and the specific drivers implement its defined APIs. For example, to connect a MySQL server, we shall use mysql:mysql-connector-java ; to connect a PostgreSQL server, we shall use org.postgresql:postgresql . Similarly, to use SQLite[2], we shall use org.xerial:sqlite-jdbc : implementation 'org.xerial:sqlite-jdbc:3.36.0.3' To use JDBC, we must import java.sql.* which defines all APIs. So when it comes to coding, the program looks nearly the same no matter which databases you are connecting to. A noticeable difference is the connection URL parameter: static Connection	getConnection​(String url) Attempts to establish a connection to the given database URL. As for SQLite, neither username nor password is required, the url must start with jdbc:sqlite:, and the path of the database file follows. For example, jdbc:sqlite:/home/zhongpu/Desktop/test.db. SQL statements are executed and results are returned within the context of Connection. As an illustration, let's write a SELECT statement in Java: String sql = "SELECT * FROM book";
try (PreparedStatement preparedStatement = connection.prepareStatement(sql)) { try (ResultSet rs = preparedStatement.executeQuery()) { while (rs.next()) { System.out.println("title = " + rs.getString("title")); System.out.println("price = " + rs.getDouble("price")); } }
} It may look a bit complicated. But don't worry, because this is perhaps the most difficult Java code when using SQL. Create PreparedStatement by Connection, which is used to execute SQL statements. Note we should care about exceptions and resource management[3]. And luckily, the try-with-resources feature can make it simple. executeQuery() is used because it is a SELECT statement, and it returns ResultSet, representing database result tuples. As ResultSet is an iterator, we can use next() to traversal from the first row to the last row by moving a cursor. When next() returns false, it means the cursor is positioned after the last row. getXXX() can retrieve the value of the designated column in the current row of this ResultSet[4]. Note that we prefer PreparedStatement to Statement[5], and its prepareStatement() can accept SQL statements containing parameter values replaced by "?". We can use setXXX() method to specify the values for the parameters[6]. To illustrate, we write an INSERT statement: String sql = "INSERT INTO author(name, birth, country) VALUES(?, ?, ?)";
try (PreparedStatement preparedStatement = connection.prepareStatement(sql)) { preparedStatement.setString(1, "Wang Xiaobo"); preparedStatement.setString(2, "1952-05-13"); preparedStatement.setString(3, "China"); preparedStatement.execute();
} As for an insertion, we don't have to care about the results, so we can use execute() or executeUpdate(). The complete code can be found at ch6/jdbc. By the way, the Java code for DELETE and UPDATE statements is nearly the same, and it is left as an exercise to readers.

