An alternative to the DriverManager facility, a DataSource object is the preferred means of getting a connection. For example, we can easily config pooled connections [8] using DataSource. In previous examples, only a single Connection is used in the whole application, and it can be a bottleneck. Connection pools promote the reuse of connection objects and reduce the number of times that connection objects are created. Connection pools significantly improve performance for database-intensive applications because creating connection objects is costly both in terms of time and resources. In case we are using Tomcat, we need to configure the DataSource as per its JDNI documentation [9]. The easiest way is to create a META-INF/context.xml in the web content, and fill it with something like: <Context> <Resource name="jdbc/db" type="javax.sql.DataSource" maxActive="30" maxIdle="10" maxWait="10000" url="jdbc:sqlite:/home/zhongpu/github/java-ee-swufe/ch6/test.db" driverClassName="org.sqlite.JDBC" />
</Context> Here, we consider the database as a resource . The complete code can be found at ch6/datasource.Let's discuss the DBCP properties briefly[10]: name : A user defined name to identify this resource. type : The resource type. In our example, it is javax.sql.DataSource. maxActive : The maximum connections being active. maxIdle : The maximum connections being idle. url , driverClassName : We have used them in the last subsection. Next, add an entry into DD: <resource-env-ref> <resource-env-ref-name>jdbc/db</resource-env-ref-name> <resource-env-ref-type>javax.sql.DataSource</resource-env-ref-type>
</resource-env-ref> This roughly means that the web application should use the server-provided DataSource with the name jdbc/db. Back to the Java code, we can use the JNDI to look up this resource: DataSource dataSource = (DataSource) new InitialContext().lookup("java:comp/env/jdbc/db");
Connection conn = dataSource.getConnection(); Here, java:comp/env is the node in the JNDI tree where you can find properties for the current Java EE component. Figure 6.3 JNDI and DataResource. We would wish this resource is singleton, and luckily, it is a default option. It means that no matter how many lookup() is called, it returns the same object. In our example, we still add the DataSource into context 's attribute, but it is not required. A good practice is to put DataResource in DBUtil class. public class DBUtil { public static DataSource getDataSource() throws NamingException { return (DataSource) new InitialContext().lookup("java:comp/env/jdbc/db"); }
} [1] The term JDBC was originally an abbreviation for Java Database Connectivity , but the full form is no longer used. [2] SQLite is serverless; it is simply a file. [3] Connection , PreparedStatement , and ResultSet should be closed to avoid computer resources exhausted. [4] The API offers many getXXX() methods, such as getInt(), getFloat(), and getDate(). [5] In general, PreparedStatement runs faster, and it can avoid SQL injection . [6] Similar to getXXX(), the API offers many setXXX() methods, such as setInt(), setFloat(), and getDate(), where the first parameter is 1, the second is 2. [7] This subsection is adapted from https://stackoverflow.com/questions/2299469/. [8] JDBC Connection Pool is also known as DBCP . [9] JNDI short for Java Naming and Directory Interface , allows Java software clients to discover and look up data and resources (in the form of Java objects) via a name. [10] Tomcat's default DBCP relies on Commons DBCP 2 and Commons Pool 2 from Apache. We can also use other alternatives, such as HikariCP , to achieve better performance.

