As you have already known, String is a Java class used to manage a sequence of characters; Date is a Java class used to provide the ability to manipulate time; Math is Java class used to extend the capabilities that handle mathematical operations... What is Servlet essentially? From the point of view of code, a servlet is no exception: it is a Java class that is used to extend the capabilities of servers that host applications accessed by means of a request-response programming model. [!TIP] A servlet is a small Java program that runs within a Web server[1]. public class HelloServlet extends HttpServlet { ... public void doGet(HttpServletRequest request, HttpServletResponse response) { ... }
} Let's take a closer look at the HelloServlet.java. As the name implies, the doGet() method is to handle the HTTP GET request and then make a response. In the plain old Java code, there must another Java class to create an instance of HelloServlet, HttpServletRequest and HttpServletResponse. Without any doubt, it is the container's responsibility. The pseudo code[2] can be described as following: // what happens in the container
HelloServlet servlet = new HelloServlet();
HttpServletRequest request = new HttpServletRequest();
HttpServletResponse response = new HttpServletResponse();
servlet.doGet(request, response); Here's a quick overview about how the container handles a request, and it illustrates what happens behind the scene of Fig.1.12. We assume that the request is an HTTP GET. Step 1 : User clicks a link that has a URL to a servlet instead of a static page. The clicking behavior would generate an HTTP request sent to the container. Figure 2.1 Step 1: User sends a request. Step 2 : The container "sees" that the request is for a servlet, so the container creates two objects: 1) HttpServletResponse and 2) HttpServletRequest. Figure 2.2 Step 2: Container creates request and response. Step 3 : The container finds the correct servlet based on the URL in the request, creates or allocates a thread for that request, and passes the request and response objects to the servlet thread[3]. Note that different accesses to the same servlet are isolated threads. [!TIP] We will revisit the thread related issues in Section 3.1 . Figure 2.3 Step 3: Container passes request and response to servlet thread. Step 4 : The container calls the servlet's doGet(), which generates a dynamic page and dumps the page into the response object. Remember, the container still has a reference to the response object. Figure 2.3 Step 4: Container calls doGet(). Step 5 : The thread completes, and the container converts the response into an HTTP response, sends it back to the client, then deletes the request and response objects[4]. Figure 2.3 Step 5: Container sends back HTTP response.

