Before we move on, we have to introduce the background of thread, an importance concept in operating systems. Process means any program is in execution. Thread means segment of a process. A single Java program, like a servlet, is a process. A thread is like a virtual CPU that can execute your Java code - inside your Java application. For example, in a downloading program, it may contain several threads to fetch the data from the server concurrently to achieve a higher speed. In Java, there is at least one thread, main thread that every Java application has. To demonstrate the current execution, we design a multi-threads program in the following[4]: class Servlet { public void service() throws InterruptedException { System.out.println("start to service..."); for (int i = 0; i < 10; i++) { System.out.println(i); Thread.sleep(500); } System.out.println("end of service..."); }
} The Servlet class is used to mimic a servlet, and it has a service() method to output values from 1 to 10. Note the Thread.sleep(500) is used to cause the currently executing thread to sleep for 500 milliseconds, and this is to mimic a consuming task in a servlet. class Container implements Runnable { private final Servlet servlet; public Container() { servlet = new Servlet(); } @Override public void run() { try { servlet.service(); } catch (InterruptedException e) { e.printStackTrace(); } }
} The Container class is used to mimic the container, and for simplicity, we add a Servlet as its member variable. Runnable is an interface that is to be implemented by a class whose instances are intended to be executed by a thread. When an object implementing interface Runnable is used to create a thread, starting the thread causes the object's run() method to be called in that separately executing thread. public class Main { public static void main(String[] args) { Container container = new Container(); Thread t1 = new Thread(container); Thread t2 = new Thread(container); t1.start(); t2.start(); }
} In the main() method, we firstly crate a Container instance, and therefore, a Servlet instance, and then start two threads to service(). As you expected, the output from 1 to 10 of the two threads are concurrently executed. It is worthwhile to observe the output on your own, and it is left as an exercise for the reader. Now it is time for REAL servlets: suppose HelloServlet is accessed by two people at the same time, then how many HelloServlet instances are there in the server? Will the container create TWO servlet objects? In general, there are not multiple instances of any servlet. If so, how can the container guarantee that the two requests won't affect each other? For example, in the book-selling website, there is a Checkout servlet. The system shall make sure that Bob won't pay for what Alice bought. To achieve this goal, the container runs multiple threads to process multiple requests to a single servlet . Therefore, every client request generates a new pair of request and response objects, and they shall not affect each other. Figure 3.3 Servlet and thread. [1] Technically, the container would load the class (i.e., bytecode ) of the servlet at the run time, and then use the technology called reflection to find and call its no-argument constructor. [2] Don't worry if you have some troubles in understanding this example, and we will illustrate it using real code in the later of this book. [3] Some readers may cannot get the point why interfaces and abstract classes are introduced here. It is a matter of design choice, and such interface -first design is very common is object oriented programming. [4] Note that the code here is only used to demonstrate the usage of thread , and it is NOT how the container is implemented.

