Till now, we only use English in the web applications. But in the real world, we would like a international website which can be accessed by people using different languages all over the world[1]. It is not trivial problem, because garbled characters are very common in real systems if i18n is not well considered. For example, there are many legacy pages from Oracle which are full of garbled characters, such as "锟斤拷" . We bet no one can interpret the meaning of 锟斤拷 : Figure 3.7 Garbled characters. In this subsection, let's investigate this problem. First of all, we design a small test to reproduce this problem in utf8.html of ch3/request: <form action="international" method="post"> <label for="name">Name: </label> <input type="text" name="name" id="name"> <button type="submit">Login in</button>
</form> And in InternationalServlet.java whose URL name is /international we try to output the name : response.setContentType("text/html");
PrintWriter out = response.getWriter();
String name = request.getParameter("name");
out.println(name); If we input Bob in the input box, the output is Box , as we expected; but if we input 小明 in the input box, the output is å°æ˜Ž . WTF? [!TIP] TL;DR There are different character set encodings, and it may produce garbled characters when converting one to another. Modern applications should use UTF-8 if you don't have special reasons to use alternatives. To understand this, you need know the background knowledge about how a string is represented . Essentially, String, as well as other objects, are a sequences of bytes [2]. Given a sequence of bytes, how to interpret it depends on the character encoding . To be precise, character encoding is the process of assigning numbers to graphical characters, especially the written characters of human language, allowing them to be stored, transmitted, and transformed using digital computers. And the character set used in encoding/decoding is usually abbreviated as charset . As an analogy, let's take an double entendre in English as an example: "What's the longest sentence in the world?" "Life sentence." Here, sentence can be 1) a set of words that is complete in itself; or 2) the punishment assigned to a defendant found guilty by a court. Anyway, the same data can convey different meanings in different interpretations . There are a larger number of character encodings . For example: ASCII: for English [3] UTF-8: for Unicode ISO 8859: for Europe GB 2312: for Chinese ... UTF-8 is by far the most common encoding for the World Wide Web, accounting for 98% of all web pages, and up to 100.0% for some languages, as of 2021[4]. So, please use UTF-8 encoding in your applications if possible. ISO 8859-1 is in the family of ISO-8859, which is used to encode western Europe languages, and it is the one what Tomcat is using. The following is what happens behind the scene. The parameters is encoded in UTF-8 by the web browser, and sent to the server. Tomcat decodes the parameters in ISO 8859-1 . Note that IOS 8859-1 can be only used to store western Europe characters. Tomcat sends this value as response in ISO 8859-1 encoding. We can notice the response encoding in Network tab: Figure 3.8 HTTP response encoding. Therefore, you cannot pass the parameters in Chinese (e.g., 你好 ) or Japanese (e.g., こんにちわ ). How to solve this problem? One solution is to specify the UTF-8 charset for both request and response. Note that the case is insensitive. request.setCharacterEncoding("utf-8");
response.setContentType("text/html;charset=utf-8"); Alternatively, you can specify the response's encoding separately: request.setCharacterEncoding("utf-8");
