As for redirect , it means when a web browser attempts to open a URL that has been redirected, a page with a different URL is opened. @WebServlet(name = "RedirectServlet", value = "/redirect")
public class RedirectServlet extends HttpServlet { @Override protected void doGet(HttpServletRequest request, HttpServletResponse response) throws IOException { response.sendRedirect("https://zhongpu.gitlab.io/java-web-book/"); }
} In the code above, when a user visit /redirect, it would send a redirect to another URL. Let's have a closer look at what it happened exactly. Step 1: As usual, the client sends an HTTP request to the server. Step 2: The server redirects this request by returning a new URL to the client[3]. Note that the response status code is 301 (indicating Moved Permanently ) or 302 (indicating Found)[4]. Step 3: After the client received the new URL, it will visit this new URL automatically. Since it is the client that does all work for a new request, the client will see the new URL. Now let's try to make some changes for the new URL. In the code above, the URL is absolute, but relative URLs are more common when using sendRedirect(). Relative URLs come in two flavors: with or without a starting forward slash ("/")[5]. Image the client originally typed in: http://localhost:8080/response/foo/redirect. When the request comes into the servlet named "redirect", the servlet calls sendRedirect() with a relative URL that does not start with a forward slash: sendRedirect("bar/test.html") Then container builds the full URL relative to the original request URL: http://localhost:8080/response/foo/bar/test.html. But if the argument to sendRedirect() starts with a forward slash: sendRedirect("/bar/test.html") Then the container builds the complete URL relative to the web container root itself . So the new URL will be: http://localhost:8080/bar/test.html. Recall that there may be several applications within a container. Readers can design tests to understand these two kinds of relative URLs[6]. [!NOTE] You cannot do a sendRedirect() after writing to the response.

