In the mini MVC project, we have used attributes to send data from controllers to views . Attributes, like init parameters, are in the form of name-value. But different from init parameters, the values can be objects , rather than simple strings. An attribute is like an object pinned to a bulletin board. Somebody stuck it on the board so that others can get it. To use attributes, we need to understand two questions: 1) Who has access to it?; 2) How long does it live? In other words, what is the scope of the attribute? Generally speaking, there are three scopes for attributes: Context : It is the ServletContext representing the web application. Request : It is the request part of a request-response model, and you can simply think of it as the HttpServletRequest object in most cases. Session : This is a key point (HttpSession) we will explain in detail later. Now you can simply think of it as several request-response phrases by the same person. For example, request.setAttribute("books", books);
RequestDispatcher dispatcher = request.getRequestDispatcher("result.jsp");
dispatcher.forward(request, response); In the code above, the attribute is in the scope of a request . Because result.jsp and this servlet use the same request when forwarding, result.jsp is able to call getAttribute() to get the attribute.

